local coins = nil



--- Called for every player when the script start or when a player join the room.
local function TouchPlayer(player_name)
	local player = players[player_name]
	-- nothing yet
end



function eventNewPlayer(player_name)
	TouchPlayer(player_name)
	tfm.exec.respawnPlayer(player_name)
end



function eventPlayerRespawn(player_name)
	tfm.exec.setNameColor(player_name, pshy.players[player_name].mario_name_color)
end



function eventPlayerDied(player_name)
	tfm.exec.changePlayerSize(player_name, 1)
	tfm.exec.respawnPlayer(player_name)
end



function eventPlayerWon(player_name)
	tfm.exec.chatMessage(string.format("<bv>[MARIO] <r>%s</r> completed the level!</bv>", player_name))
	tfm.exec.respawnPlayer(player_name)
end



function eventInit()
	for player_name in pairs(tfm.get.room.playerList) do
		TouchPlayer(player_name)
	end
	pshy.newgame_ChatCommandRotc(user, "mario2") -- TODO: have a function for setting the rotation in `pshy_newgame.lua`!
	tfm.exec.newGame("mario2")
end
